import React from "react";

function Tiny() {
    return (
        <>
            <div>
                <nav>
                    <div className="logo">
                        <img src="./assests/logo.png" alt="" />
                        <h1>Hello</h1>
                    </div>
                    <div className="nav_links"></div>
                </nav>
            </div>
        </>
    );
}
export default Tiny;
